post_text:
Class of 2020 Shout Out from coach Walecka!

Senior Shout Out is to John Goncalves!

This was his first spring season, but Mr. Breault noted,”John was a great role model & leader for the throwers,always in the weight room,&an enthusiastic supporter of his teammates.” He is majoring in History at UMassD!
